import Items from "../Items.jsx";
import Header from "../Header.jsx";
export default function HomePage({
  cartItems,
  items,
  handleAddToCart,
  isLogged,
  handleLogOut,
}) {
  return (
    <>
      <Header
        amountCart={cartItems.length}
        isLogged={isLogged}
        handleLogOut={() => handleLogOut("", false)}
      />
      <Items items={items} addToCart={handleAddToCart} isLogged={isLogged} />
    </>
  );
}
